import './App.css';
import { Cart, Main } from './pages';
import { Route } from 'react-router-dom';
import { BrowserRouter as Router } from 'react-router-dom';


const Privet = () => {
  return <p>Привет</p>;
};

const Poka = () => {
  return <p>Пока</p>;
};

function App() {
  return (
    <Router>

      <span>Привет</span>

      <Route path="/" component={Privet} />
      <Route path="/cart" component={Poka} />

    </Router>
  );
}

export default App;
